INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 1, 0.0, 106001, "キャル", -363.0, 0.0, 1, 7001, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 7, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 1, 0.0, 105901, "コッコロ", -363.0, 0.0, 1, 7002, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 7, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 1, 0.0, 105801, "ペコリーヌ", -363.0, 0.0, 1, 7003, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 7, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 1, 0.0, 105801, "ペコリーヌ", -363.0, 0.0, 1, 10001, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 10, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 1, 0.0, 106001, "キャル", -363.0, 0.0, 1, 10002, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 10, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 1, 0.0, 105901, "コッコロ", -363.0, 0.0, 1, 10003, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 10, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (2, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 1, 0.0, 106401, "シェフィ", -363.0, 0.0, 1, 10004, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 2104010, 10, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 1, 0.0, 105801, "ペコリーヌ", -416.5, 0.0, 1, 12001, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 12, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 1, 0.0, 106001, "キャル", -363.0, 0.0, 1, 13001, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 13, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 1, 0.0, 105901, "コッコロ", -363.0, 0.0, 1, 13002, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 13, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (2, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 1, 0.0, 106401, "シェフィ", -363.0, 0.0, 1, 13003, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 2104010, 13, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 1, 0.0, 105801, "ペコリーヌ", -363.0, 0.0, 1, 13004, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 13, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 1, 0.0, 105901, "コッコロ", -363.0, 0.0, 1, 14001, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 14, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (2, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 1, 0.0, 106401, "シェフィ", -363.0, 0.0, 1, 14002, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 2104010, 14, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 1, 0.0, 105801, "ペコリーヌ", -363.0, 0.0, 1, 14003, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 14, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 1, 0.0, 106001, "キャル", -363.0, 0.0, 1, 14004, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 14, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 1, 0.0, 105901, "コッコロ", -470.0, 0.0, 1, 15001, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 15, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (2, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 1, 0.0, 106401, "シェフィ", -363.0, 0.0, 1, 16001, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 2104010, 16, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 1, 0.0, 105801, "ペコリーヌ", -363.0, 0.0, 1, 16002, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 16, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 1, 0.0, 106001, "キャル", -363.0, 0.0, 1, 16003, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 16, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 1, 0.0, 105901, "コッコロ", -363.0, 0.0, 1, 16004, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 16, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 1, 0.0, 105901, "コッコロ", -363.0, 0.0, 1, 17002, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 17, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 1, 0.0, 106001, "キャル", -363.0, 0.0, 1, 17004, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 25, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 1, 0.0, 105901, "コッコロ", -363.0, 0.0, 1, 17005, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 25, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (2, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 1, 0.0, 106401, "シェフィ", -363.0, 0.0, 1, 17006, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 2104010, 25, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 1, 0.0, 105801, "ペコリーヌ", -363.0, 0.0, 1, 17007, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 25, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 1, 0.0, 190801, "カリン", -363.0, 0.0, 1, 18001, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 18, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 2, 0.0, 190801, "カリン", -363.0, 0.0, 1, 18002, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 18, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 3, 0.0, 190801, "カリン", -470.0, 0.0, 1, 19001, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 19, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 4, 0.0, 190801, "カリン", -470.0, 0.0, 1, 19002, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 19, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 5, 0.0, 190801, "カリン", -470.0, 0.0, 1, 20001, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 20, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 6, 0.0, 190801, "カリン", -470.0, 0.0, 1, 20002, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 20, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 1, 0.0, 106001, "キャル", -363.0, 0.0, 1, 21001, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 21, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 1, 0.0, 105901, "コッコロ", -363.0, 0.0, 1, 21002, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 21, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (2, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 1, 0.0, 106401, "シェフィ", -363.0, 0.0, 1, 21003, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 2104010, 21, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 1, 0.0, 105801, "ペコリーヌ", -363.0, 0.0, 1, 21004, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 21, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 1, 0.0, 190801, "カリン", -430.0, 0.0, 1, 22001, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 22, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 2, 0.0, 190801, "カリン", -430.0, 0.0, 1, 22002, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 22, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 3, 0.0, 190801, "カリン", -430.0, 0.0, 1, 23001, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 23, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 4, 0.0, 190801, "カリン", -430.0, 0.0, 1, 23002, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 23, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 1, 4.08, 109001, "エリコ（バレンタイン）", -385.0, 8.0, 2, 24001, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0, 24, 10011);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 2, 5.0, 109001, "エリコ（バレンタイン）", -385.0, 8.0, 2, 24002, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0, 24, 10011);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 3, 10.11, 109001, "エリコ（バレンタイン）", -385.0, 8.0, 2, 24003, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0, 24, 10011);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 4, 4.0, 109001, "エリコ（バレンタイン）", -385.0, 8.0, 2, 24004, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0, 24, 10011);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 5, 6.0, 109001, "エリコ（バレンタイン）", -385.0, 8.0, 2, 24005, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0, 24, 10011);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 6, 0.0, 109002, "エリコ（バレンタイン）", 0.0, 0.0, 1, 24006, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0, 24, 10011);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 7, 0.0, 109002, "エリコ（バレンタイン）", 0.0, 0.0, 1, 24007, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0, 24, 10011);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 8, 0.0, 109002, "エリコ（バレンタイン）", 0.0, 0.0, 1, 24008, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0, 24, 10011);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 9, 0.0, 109002, "エリコ（バレンタイン）", 0.0, 0.0, 1, 24009, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0, 24, 10011);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 10, 0.0, 109002, "エリコ（バレンタイン）", 0.0, 0.0, 1, 24010, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0, 24, 10011);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 1, 2.12, 109101, "シズル（バレンタイン）", -385.0, 8.0, 2, 24011, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0, 24, 10011);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (5, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 2, 4.19, 109101, "シズル（バレンタイン）", -385.0, 8.0, 2, 24012, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0, 24, 10011);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (2, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 3, 2.3, 109101, "シズル（バレンタイン）", -385.0, 8.0, 4, 24013, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0, 24, 10011);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 4, 0.0, 109102, "シズル（バレンタイン）", 0.0, 0.0, 1, 24014, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0, 24, 10011);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (5, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 5, 5.23, 109101, "シズル（バレンタイン）", -385.0, 8.0, 2, 24015, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0, 24, 10011);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 6, 0.0, 109102, "シズル（バレンタイン）", 0.0, 0.0, 1, 24016, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0, 24, 10011);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 7, 5.01, 109101, "シズル（バレンタイン）", -385.0, 8.0, 2, 24017, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0, 24, 10011);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 8, 0.0, 109102, "シズル（バレンタイン）", 0.0, 0.0, 1, 24018, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0, 24, 10011);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 9, 0.0, 109102, "シズル（バレンタイン）", 0.0, 0.0, 1, 24019, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0, 24, 10011);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 10, 0.0, 109102, "シズル（バレンタイン）", 0.0, 0.0, 1, 24020, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0, 24, 10011);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (2, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", 1, 0.0, 106401, "シェフィ", -363.0, 0.0, 1, 26001, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 2104010, 26, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", 1, 0.0, 105801, "ペコリーヌ", -363.0, 0.0, 1, 26002, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 26, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", 1, 0.0, 106001, "キャル", -363.0, 0.0, 1, 26003, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 26, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", 1, 0.0, 105901, "コッコロ", -363.0, 0.0, 1, 26004, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 26, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (2, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", 1, 0.0, 106401, "シェフィ", -363.0, 0.0, 1, 27001, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 2104010, 27, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", 1, 0.0, 105801, "ペコリーヌ", -363.0, 0.0, 1, 27002, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 27, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", 1, 0.0, 106001, "キャル", -363.0, 0.0, 1, 27003, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 27, 0);
