INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。", 1, 0.0, 105901, "コッコロ", -363.0, 0.0, 1, 41004, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 41, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。", 1, 0.0, 105901, "コッコロ", -416.5, 0.0, 1, 42001, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 42, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。", 1, 0.0, 106401, "シェフィ", -416.5, 0.0, 1, 42002, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 2104010, 42, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆", 1, 0.0, 105801, "ペコリーヌ", -416.5, 0.0, 1, 42003, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 42, 0);
