INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", 1, 0.0, 105801, "ペコリーヌ", -363.0, 0.0, 1, 43001, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 43, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", 1, 0.0, 105901, "コッコロ", -363.0, 0.0, 1, 43002, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 43, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", 1, 0.0, 106001, "キャル", -363.0, 0.0, 1, 43003, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 43, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", 1, 0.0, 123001, "アメス", -416.5, 0.0, 1, 43004, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 44, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", 2, 0.0, 123001, "アメス", -416.5, 0.0, 1, 43005, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 44, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", 3, 5.79, 123001, "アメス", -416.5, 0.0, 2, 43006, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 45, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", 1, 0.0, 123001, "アメス", -371.5, 0.0, 1, 46001, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 46, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (2, "呼ばれて飛び出てお姉ちゃんだよ♪\nたとえ火の中、水の中、迷宮の中っ\nこのダンジョンを踏破できるよう\n弟くんを応援してあげるからねっ♪", 1, 0.0, 104901, "シズル", -416.5, 0.0, 2, 47001, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 47, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (1, "ほんとーに不思議な場所ですね～\nお兄ちゃんが冒険を頑張れるよう\nおまじないをかけてあげますねっ\nフレーフレー、お・兄・ちゃんっ♪", 1, 9.32, 101101, "リノ", -416.5, 0.0, 2, 47002, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 47, 0);
